import React from 'react';
import logo from './logo.svg';
import './App.css';



const Li: React.FC<{palabra:string}> = ({palabra})=> {
  console.log(palabra);
  return <li>{palabra}</li>;
}

const App = () => {
  let x: string = "hola emma";
  return (
    <ul>
      <Li palabra={x}></Li>
    </ul>
  );
};

export default App;
